<script>
export default {
  // 使用說明：
  // 顯示愛心標籤+ likes; 顯示日期+date
  // 標籤+ asong顯示單曲，不+顯示專輯
  props: {
    songimg: {
      type: String,
      required: true,
      default: 'https://picsum.photos/900'
    },
    asong: {
      type: Boolean,
      required: false,
      default: false
    },
    titles: {
      type: String,
      required: true,
      default: '在這座城市遺失了你'
    },
    author: {
      type: String,
      required: true,
      default: '告五人'
    },
    likes: {
      type: Boolean,
      required: false,
      default: false
    },
    date: {
      type: Boolean,
      required: false,
      default: false
    },
    albumname: {
      type: String,
      required: true,
      default: '運氣來得若有似無'
    },
    years: {
      type: Number,
      required: true,
      default: 2020
    },
    songnum: {
      type: Number,
      required: true,
      default: 12
    },
    times: {
      type: String,
      required: true,
      default: '00:51:03'
    }
  },
  data () {
    return {
      turnOn: 'off',
      playPause: require('../assets/icon/play_fff.svg'),
      likeRed: false,
      now: new Date()
    }
  },
  methods: {
    playFun () {
      if (this.turnOn === 'off') {
        this.turnOn = 'on'
        this.playPause = require('../assets/icon/pause_fff.svg')
      } else if (this.turnOn === 'on') {
        this.turnOn = 'off'
        this.playPause = require('../assets/icon/play_fff.svg')
      }
    },
    actionFun () {
      this.likeRed = !this.likeRed
      console.log(this.likeRed)
    }
  },
  mounted () {
  }
}

